DROP TABLE IF EXISTS wines_spa;
create table wines_spa
(
    id          int auto_increment
        primary key,
    winery      text   null,
    wine        text   null,
    year        int    null,
    rating      double null,
    num_reviews int    null,
    country     text   null,
    region      text   null,
    price       double null,
    type        text   null,
    body        int    null,
    acidity     int    null
);

